import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card.js';
import 'tachyons';
import reportWebVitals from './reportWebVitals';
import { robots } from './robots.js';

ReactDOM.render(
      <div>
        <Card image={robots[0].image} id={robots[0].id} name={robots[0].name} email={robots[0].email}/>
        <Card image={robots[1].image} id={robots[1].id} name={robots[1].name} email={robots[1].email}/>
        <Card image={robots[2].image} id={robots[2].id} name={robots[2].name} email={robots[2].email}/>
        <Card image={robots[3].image} id={robots[3].id} name={robots[3].name} email={robots[3].email}/>
        <Card image={robots[4].image} id={robots[4].id} name={robots[4].name} email={robots[4].email}/>
        <Card image={robots[5].image} id={robots[5].id} name={robots[5].name} email={robots[5].email}/>
        <Card image={robots[6].image} id={robots[6].id} name={robots[6].name} email={robots[6].email}/>
        <Card image={robots[7].image} id={robots[7].id} name={robots[7].name} email={robots[7].email}/>
      </div>  
  , document.getElementById('root'));
reportWebVitals();
